import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './booktickets.css';
import SideMenu from './SideMenu';

function BookTickets() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    flight: '',
    location: '',
    date: '',
    flightNumber: '', // Added flightNumber
  });
  const [totalFare, setTotalFare] = useState(0);
  const [transactionSuccess, setTransactionSuccess] = useState(false);
  const [fareToDisplay, setFareToDisplay] = useState(0);

  const fareMapping = {
    Emirates: 500,
    AirIndia: 400,
    SpiceJet: 300,
    KuwaitAirways: 450,
    QatarAirways: 550,
    EthihadAirways: 600,
    JetAirways: 350,
    Vistara: 400,
    AirArabia: 320,
    OmanAirways: 500,
    SilkAir: 480,
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });

    if (name === 'flight') {
      const selectedFare = fareMapping[value] || 0;
      setTotalFare(selectedFare);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const passengerData = {
      ...formData,
      tstatus: 'departure',
    };

    try {
      await axios.post('http://localhost:8080/Passenger/Insertpass', passengerData);
      setFareToDisplay(totalFare);
      setTransactionSuccess(true);
    } catch (error) {
      console.error("There was an error inserting the passenger!", error);
    }
  };

  if (transactionSuccess) {
    return (
      <div className="transaction-container">
        <div className="transaction-success">
          <div className="tickmark">&#10004;</div>
          <h2>Transaction Successful</h2>
          <p>Your booking has been completed successfully!</p>
          <p>Total Fare: Rupees {fareToDisplay}</p>
        </div>
      </div>
    );
  }

  return (
    <div className="book-tickets-container">
      <form onSubmit={handleSubmit}>
        <h2>Book Your Flight</h2>
        <div className="form-group">
          <label>Flight:</label>
          <select
            className="flights"
            name="flight"
            value={formData.flight}
            onChange={handleChange}
            required
          >
            <option value="">Select Flight</option>
            <option value="Emirates">Emirates</option>
            <option value="AirIndia">Air India</option>
            <option value="SpiceJet">Spice Jet</option>
            <option value="KuwaitAirways">Kuwait Airways</option>
            <option value="QatarAirways">Qatar Airways</option>
            <option value="EthihadAirways">Ethihad Airways</option>
            <option value="JetAirways">Jet Airways</option>
            <option value="Vistara">Vistara</option>
            <option value="AirArabia">Air Arabia</option>
            <option value="OmanAirways">Oman Airways</option>
            <option value="SilkAir">Silk Air</option>
          </select>
        </div>
        <div className="form-group">
          <label>Flight Number:</label>
          <input
            type="text"
            name="flightNumber" // Updated name to flightNumber
            placeholder="Flight Number"
            value={formData.flightNumber} // Updated value to flightNumber
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Location:</label>
          <input
            type="text"
            name="location"
            placeholder="Location"
            value={formData.location}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Departure Date:</label>
          <input
            type="date"
            name="date"
            value={formData.date}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Name:</label>
          <input
            type="text"
            name="name"
            placeholder="Name"
            value={formData.name}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            name="email"
            placeholder="Email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Phone Number:</label>
          <input
            type="text"
            name="phone"
            placeholder="Phone"
            value={formData.phone}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Total Fare: Rupees {totalFare}</label>
        </div>
        <button type="submit">Book Now</button>
      </form>
      <SideMenu />
    </div>
  );
}

export default BookTickets;
